import React from 'react';

import { BsFlag } from "react-icons/bs";

function Report(props) {

    const test = (event) => {
        alert("Click on button Option here");
      };

    return (
        <button
                  type="button"
                  className="btn btn-link dropdown-item"
                  onClick={test}
                >
                  <BsFlag className="icon" />
                  Report
                </button>
    )
}

export default Report
